import React, { Fragment, useState } from "react";

const Register = () => {
  return (
    <Fragment>
      <h1>Register</h1>
      <form>
        <input type="email" name="email" placeholder="email" />
        <input type="email" name="email" placeholder="email" />
        <input type="email" name="email" placeholder="email" />
      </form>
    </Fragment>
  );
};

export default Register;
